import React, { useState } from "react";

const App = () => {
  const [count, setCount] = useState(0);

  const incMent = () => {
    setCount(count + 15);
  };
  const dncMent = () => {
    setCount(count - 12);
  };
  return (
    <div>
      <h1>{count}</h1>
      <button onClick={incMent}>incrise</button>
      <button onClick={dncMent}>decrise</button>
    </div>
  );
};

export default App;
